// SPDX-License-Identifier: MIT
pragma solidity >=0.6.1 <0.9.0;

contract SimpleStorage {

    // initialize to zero
    uint public storeData;

    function set(uint x) public {
        storeData = x;
        storeData = storeData + 1;
    }

    function get() public view returns (uint) {
        return (storeData);
    }

}

